def solve(num):
    count = 0
    while num % 2 == 0:
        count += 1
        num = num / 2
    for i in range(3, int(num**0.5) + 1, 2):
        while num % i == 0:
            count += 1
            num = num / i
    if num > 2:
        count += 1
    return count
